import React from 'react';
import './Footer.css';
import logoTwitter from '../logoTwitter.png'
import logoFacebook from '../logoFacebook.png'
import logoInstagram from '../logoInsta.png'

const footerSrub = [
  {
    linkFb: "http://www.facebook.com",
    logoFb: "logoFacebook"
  },
  {
    linkTwitter: "https://twitter.com/login?lang=fr",
    logoTwit: "logoTwitter"
  },
  {
    linkInsta: "https://instagram.com",
    logoInsta: "logoInstagram"
  },

]

const Footer = () => {

    return (
      <footer className="footerDistributed">

        <div className="footerRight">

            <a className="footerIcon" href="http://www.facebook.com"><img className="footerImg"src={logoFacebook}/></a>


        </div> 

        <div className="footerLeft">  

          <p className="footerLinks">  
             <a href="home"> Home </a>
             <a href="selected-profil"> Selected Profil </a>    
             <a href="my-account"> My Account </a> 
             <a href="legal-mentions"> Legal Mentions </a>
             <a href="contact"> Contact us </a>   

          </p> 
          <p> Scrub &copy; 2019 </p>
         </div>

      </footer>

    )     
    }

export default Footer;
